import React from 'react';
import SpinnerGIF from './spinner.gif'

const Spinner = () => {
    return (
        <div className="red">
            <img src={SpinnerGIF} style={{width: '3%', margin: 'auto', display: 'block'}} alt="Loading..." />
        </div>
    )
}

export default Spinner
